script: |
  super -f tsv -I q203.sql | sort > q203.out

vector: true

inputs:
  - name: q203.sql
    data: |
      SELECT ALL + 71 AS col0, ( - - CAST ( - CAST ( + MIN ( ALL - col2 ) AS INTEGER ) AS INTEGER ) ) AS col2 FROM tab1 AS cor0 WHERE NOT ( NULL ) IS NULL;
  - name: tab1

outputs:
  - name: q203.out
    data: |
      71	NULL
